import './rating.css';

import fill from '../../assets/business/star-filled.png';
import half from '../../assets/business/star-half-fill.png';
import empty from '../../assets/business/star-half-fill.png';

function Rating({rating}) {
    var numFill = Math.floor(rating);
    if (rating - numFill > 0) {
        var halfFill = true;
    }
    var empty = 5 - Math.ceil(rating);
    var starArray = [];
    for (var i = 0; i < numFill - 1 ; i++) {
        fillArray.push(<img src={fill} />);
    };

    if(halfFill) {
        fillArray.push(<img src={half} />);
    };

    for (var i = 0; i < empty - 1; i++) {
        fillArray.push(<img src={empty} />);
    }

    return (
        <div>
            {fillArray}
            <img src={fill} />
        </div>
    )
}

export default Rating;
